import React from "react";
import { useEffect,useState } from "react";
import './login.styles.css';
import Baseurl from "../../components/baseurl/Baseurl.component";
import { useNavigate } from "react-router";

export default function Login(){
const navigate = useNavigate();
    const mystyle = {
        paddingLeft: "2.5rem",
        paddingRight: "5rem"
      };
    const {http,setToken}=Baseurl();
    const [email,setEmail]=useState('');
    const [password,setPassword]=useState('');

    // errors
    const [EmailError,setEmailError] = useState('');
    const [PasswordError,setPasswordError] = useState('');
    const loginSubmit=(()=>{
       
        http.post('/login',{email:email,password:password}).then((res)=>{ 
           if(res.data.status==false){
             //alert(res.data.message);
             setEmailError(res.data.errors.email);
             setPasswordError(res.data.errors.password);
             navigate('admin/login');
           }else{
            alert(res.data.message);
            setToken(res.data.user,res.data.access_token,res.data.message);
           }
        })
    })

    return(
        <div>
            <section className="vh-100">
  <div className="container-fluid h-custom">
    <div className="row d-flex justify-content-center align-items-center h-100">
      <div className="col-md-9 col-lg-6 col-xl-5">
        <img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.webp"
          className="img-fluid" alt="Sample image"/>
      </div>
      <div className="col-md-8 col-lg-6 col-xl-4 offset-xl-1">
        <form>
          <div className="d-flex flex-row align-items-center justify-content-center justify-content-lg-start">
            <p className="lead fw-normal mb-0 me-3">Sign in with</p>
            <button type="button" className="btn btn-primary btn-floating mx-1">
              <i className="fab fa-facebook-f"></i>
            </button>

            <button type="button" className="btn btn-primary btn-floating mx-1">
              <i className="fab fa-twitter"></i>
              
            </button>

            <button type="button" className="btn btn-primary btn-floating mx-1">
              <i className="fab fa-linkedin-in"></i>
            </button>
          </div>

          <div className="divider d-flex align-items-center my-4">
            <p className="text-center fw-bold mx-3 mb-0">Or</p>
          </div>

        
          <div className="form-outline mb-4 text-start">
            <input type="email" id="form3Example3" className="form-control form-control-lg"
              placeholder="Enter a valid email address"
              onChange={e=>setEmail(e.target.value)}
              />
              <span className="text-danger">{EmailError}</span><br/>
            <label className="form-label" for="form3Example3">Email address</label>
          </div>

       
          <div className="form-outline mb-3 text-start">
            <input type="password" id="form3Example4" className="form-control form-control-lg"
              placeholder="Enter password"
              onChange={e=>setPassword(e.target.value)}
              />
             <span className="text-danger">{PasswordError}</span>
            <label className="form-label" for="form3Example4">Password</label>
          </div>

          <div className="d-flex justify-content-between align-items-center">
            
            <div className="form-check mb-0">
              <input className="form-check-input me-2" type="checkbox" value="" id="form2Example3" />
              <label className="form-check-label" for="form2Example3">
                Remember me
              </label>
            </div>
            <a href="#!" className="text-body">Forgot password?</a>
          </div>

          <div className="text-center text-lg-start mt-4 pt-2">
            <button type="button" className="btn btn-primary btn-lg"
              style={mystyle}
              onClick={loginSubmit}
              >Login</button>
           
          </div>

        </form>
      </div>
    </div>
  </div>
  <div
    class="d-flex flex-column flex-md-row text-center text-md-start justify-content-between py-4 px-4 px-xl-5 bg-primary">
   
    <div class="text-white mb-3 mb-md-0">
      Copyright Â© 2020. All rights reserved.
    </div>
    
    <div>
      <a href="#!" class="text-white me-4">
        <i class="fab fa-facebook-f"></i>
      </a>
      <a href="#!" class="text-white me-4">
        <i class="fab fa-twitter"></i>
      </a>
      <a href="#!" class="text-white me-4">
        <i class="fab fa-google"></i>
      </a>
      <a href="#!" class="text-white">
        <i class="fab fa-linkedin-in"></i>
      </a>
    </div>
  
  </div>
</section>
        </div>
    );
}
